(27, 'Yannis', 'Je sais pas, et faut que le prof puisse la parcourir, donc je te conseil pas trop.<br />\r\n<br />\r\nMais stv, tu peux mettre un formulaire par défaut, dans les options d\'access.<br><img src=\"uploads/Capture.PNG\" alt=\"Capture.PNG\">', 6, '178.195.231.40', NULL, '2019-01-14 13:33:58', 0),
(28, 'Ethan', 'Je m\'explique : En gros j\'ai mon formulaire personne qui est le principale tout fonctionne ett mais j\'aimerai réussir à que : quand je change de formulaire depuis mon formulaire personne ( je click sur mon bouton jsp personne-email) pour pouvoir liés un email à une personne et bah dans la liste déroulante FK_Personne et bah il s\'affiche directement la personne sur la quelle j\'étais dans mon formulaire juste avant ( personne) en gros si mon formulaire pesonne et vide et que je click sur mon bouton personne-email et bah rien ne s\'affiche vu qu\'il n\'y avait personne de sélectionner dans mon formulair personne mais si il y  a moi avec mes infomations et et que je click sur mon bouton j\'aimerai que le formulaire récupère directement la personne ( en locurrence moi dans ce cas ) je sais pas si tu as tout compris mais je n\'ai pas réussi à faire celà aurais-tu une idée ?? <br />\r\n<br />\r\nJe fais avec des maccros !!', 7, '62.2.125.230', NULL, '2019-01-15 10:24:33', 0),
(29, 'Yannis', 'ok,<br />\r\n<br />\r\nDans le bouton + qui doit être dans ton form F_Personne, tu mets ce code :<br />\r\nDoCmd.OpenForm &quot;F_Personne_Email&quot;, acNormal, , , acFormAdd, acWindowNormal, Me.ID_Personne.Value<br />\r\nLe dernier paramètre permet de faire passer une valeur, ici l\'ID_Personne, à un autre formulaire.<br />\r\n<br />\r\nDans ton formulaire de liaison entre T_Personne et T_Email, dans l\'événement &quot;Sur chargement&quot; tu mets ça :<br />\r\nPrivate Sub Form_Load()<br />\r\n	For i = 0 To Me.FK_Personne.ListCount<br />\r\n		If Me.FK_Personne.Column(0, i) = Me.OpenArgs Then<br />\r\n			Me.FK_Personne.SetFocus<br />\r\n			Me.FK_Personne.ListIndex = i<br />\r\n		End If<br />\r\n	Next i<br />\r\nEnd Sub<br />\r\n<br />\r\nC\'est une boucle qui parcours toutes les lignes et prend celle dont l\'ID est celui passé par le formulaire plus haut.<br />\r\n<br />\r\n<br />\r\nN\'oublie pas de remplacer les noms des champs par les tiens et je te passe aussi la base de données que j\'ai utilisé pour faire les tests si tu veux voir directement dedans.<br><a href=\"uploads/BDD_Demo.accdb\">BDD_Demo.accdb</a>', 7, '62.167.232.232', NULL, '2019-01-16 16:51:17', 0),
