(126, 'Yannis', 'Ça dépends du niveau de complexité que tu veux atteindre. Comme ça je pense que c\'est possible. Pour te rendre mieux compte de la difficulté je te conseil de lister les principales fonctions. Si il y en a trop ou qu\'elles ont l\'air trop compliqué, alors il faudrait trouver un autre sujet mais à voir.<br />\r\n<br />\r\nLes fonctions que je pense les plus importantes :<br />\r\n - Liste des produits (rayon, catégorie, prix, etc) -&gt; ça c\'est de la pure base de données relationnelle<br />\r\n - Ajout et retrait dans la stock<br />\r\n - Plusieurs vendeurs<br />\r\n<br />\r\nOui ça me parait largement jouable et s\'il faut je peux toujours t\'aider. : )', 28, '109.164.215.100', NULL, '2019-03-18 08:44:03', 0),
