(147, 'Yannis', 'Tu dois prendre la dernière version dispo sur Moodle.<br />\r\nLa dézipper dans un dossier.<br />\r\nOuvrir ce dossier dans Visual Code Studio.<br />\r\nImporter le fichier .sql dans uWamp.<br />\r\nClic droit sur le fichier hello_flask.py et faire Run Python File in Terminal<br />\r\nAller à l\'adresse http://localhost:5000 dans ton navigateur.<br />\r\nNormalement tu devrais avoir une page d\'accueil qui s\'affiche.', 34, '62.167.232.232', NULL, '2019-04-24 19:21:50', 0),
