(194, 'Yannis', 'Oui, si tu te débrouilles bien ça devrait pas être trop difficile (je pense).<br />\r\n<br />\r\nDéjà, dans les fonctions Python add et edit, tu devras faire une requête en plus, une requête qui sélectionne tous les sexes. Tu devras passer le résultats à ton fichier HTML via render_template.<br />\r\n<br />\r\nDans l\'HTML (les 2, add et edit), tu devras mettre un &lt;select&gt; et faire une boucle for de tous tes sexes à l\'intérieur et pour chaque sexe, afficher un option dans le select.<br />\r\n<br />\r\n<br />\r\nÇa devrait ressembler à ça :<br />\r\n<br />\r\n<pre>\r\n&lt;select name=&quot;sexe_personne&quot;&gt;\r\n	{% for(sexe in data_sexes %}\r\n		&lt;option value=&quot;{{ sexe[\'id_sexe\'] }}&quot;&gt;{{ sexe[\'nom_sexe\'] }}&lt;/option&gt;\r\n	{% endfor %}\r\n&lt;/select&gt;\r\n</pre>\r\n<br />\r\n<br />\r\nSi tu veux que le sexe déjà sélectionner revienne, tu devras mettre une petite condition à la ligne &lt;option&gt; :<br />\r\n<br />\r\n&lt;option value=&quot;{{ sexe[\'id_sexe\'] }}&quot; {{ \'selected\' if sexe[\'id_sexe\'] == row[\'fk_sexe\'] }}&gt;{{ sexe[\'nom_sexe\'] }}&lt;/option&gt;<br />\r\n<br />\r\n<br />\r\nAprès, dans la fonction Update du Python, il suffira d\'enregistrer la valeur renvoyé par le &lt;select&gt; et de l\'insérer dans la BDD.<br />\r\n<br />\r\nMais attention, fais quand même une copie avant de faire tes tests ; )<br />\r\n', 46, '109.164.215.100', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:67.0) Gecko/20100101 Firefox/67.0', '2019-05-24 12:10:02', 0),
